import os
import csv

def process_email_summaries(directory):
    isps = {}

    for filename in os.listdir(directory):
        vso_id, _ = os.path.splitext(filename)

        with open(os.path.join(directory, filename), 'r', encoding='utf-8') as file:
            reader = csv.DictReader(file, delimiter='\t')
    
            for row in reader:
                if "ISP" in row:
                    isp_name = row["ISP"]
                    if isp_name not in isps:
                        isps[isp_name] = []
                    isps[isp_name].append(vso_id)
    return isps


email_summaries_directory = 'test/email_summaries'
isps = process_email_summaries(email_summaries_directory)

print(f"unknown: {isps['Unknown']}")
print(f"N/A: {isps['N/A']}")
print(f"-: {isps['-']}")
print(f"-: {isps['']}")

